import React, { Component } from 'react';
import Navigation from './components/Navigation/Navigation';
import Logo from './components/Logo/Logo';
import ImageLinkForm from './components/ImageLinkForm/ImageLinkForm';
import Rank from './components/Rank/Rank';
import './App.css';
import ParticlesBg from 'particles-bg';

const returnClarifaiRequest = (imageUrl) => {

   const PAT = '7de6dc495cc446809746bff75fe8eb2d';
   const USER_ID = 'clarifaiapiel21';       
   const APP_ID = 'face-detection';
   const MODEL_ID = 'face-detection';
   const IMAGE_URL = imageUrl;

   const raw = JSON.stringify({
      "user_app_id": {
         "user_id": USER_ID,
         "app_id": APP_ID
      },
      "inputs": [
         {
               "data": {
                  "image": {
                     "url": IMAGE_URL
                  }
               }
         }
      ]
   });

   const requestOptions = {
      method: 'POST',
      headers: {
         'Accept': 'application/json',
         'Authorization': 'Key ' + PAT
      },
      body: raw
   };

   return requestOptions;
}

fetch("https://api.clarifai.com/v2/models/" + MODEL_ID + "/versions/" + "/outputs", requestOptions)
   .then(response => response.text())
   .then(result => console.log(result))
   .catch(error => console.log('error', error));

class App extends Component {
   constructor(){
      super();
      this.state = {
         input: '',
      }
   }

   onInputChange = (event) => {
      console.log(event.target.value);
   }

   onBtnSubmit = () => {
      console.log('click');
   }

   render() {
      return (
         <div className="App">
         <ParticlesBg color="#FFEE00" num={100} type="cobweb" bg={true}/>
         <Navigation />
         <Logo />
         <ImageLinkForm onInputChange={this.onInputChange} onBtnSubmit={this.onBtnSubmit}/>
         <Rank />
         {/* 

            <FaceDetection /> */}

         </div>
      );
   };
}

export default App;
